import "./App.css";
import ExpenseItem from "./components/ExpenseItem";

function App() {
  let data = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.49,
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div className="App">
      <header className="App-header"></header>
      <div>
        <ExpenseItem title={data[0].title} amount={ data[0].amount} date={ data[0].date } />
        <ExpenseItem title={data[1].title} amount={ data[1].amount} date={ data[1].date } />
        <ExpenseItem title={data[2].title} amount={ data[2].amount} date={ data[2].date } />
        <ExpenseItem title={data[3].title} amount={ data[0].amount} date={ data[0].date } />
      </div>
    </div>
  );
}

export default App;
